all prepared by Fraser Brown MacKenna Architects.

Reason:  For the avoidance of doubt and in the interests of proper planning.

Construction Environmental Management Plan (CEMP)

No development shall commence in a Development Parcel until a Construction Environmental Management Plan (CEMP) and a Site Waste Management Plan (SWMP) for the relevant Development Parcel has been submitted to and approved in writing by the Local Planning Authority.  These plans shall incorporate details of:

a)  the parking of vehicles of site operatives and visitors;
b)  loading and unloading of plant and materials;
c)  storage of plant and materials used in constructing the development;
d)  the erection and maintenance of security hoarding(s) including decorative displays and facilities for public viewing, where appropriate;
e)  wheel washing facilities;
f)  measures to control the emission of dust, dirt and emissions to air during construction; such measures to accord with the guidance provided in the document "The Control of Dust and Emissions during construction and demolition", Mayor of London, July 2014; including but not confined to, non-road mobile machinery (NRMM) requirements;
g)  a scheme for recycling/disposing of waste resulting from demolition and construction works;
h)  the use of efficient construction materials;
i)  methods to minimise waste, to encourage re-use, recovery and recycling, and sourcing of materials; and
j)  a nominated Developer/Resident Liaison Representative with an address and contact telephone number to be circulated to those residents consulted on the application by the developer's representatives.  This person will act as first point of contact for residents who have any problems or questions related to the ongoing development.

Demolition and construction work and associated activities are to be carried out in accordance with the recommendations contained within British Standard 5228:2009, "Code of practice for noise and vibration control on construction and open sites", Parts 1 and 2.

The approved CEMP and SWMP shall be implemented for the entire period of the construction works at the site, to the satisfaction of the Local Planning Authority. 

Reason:  The CEMP and SWMP are required prior to commencement of development in a Development Parcel in order to reduce the environmental impact of the construction phase and the impact on the amenities of neighbouring residents, and in accordance with policy BP8 of the Borough Wide Development Policies Development Plan Document.
